import { faJsSquare } from '@fortawesome/free-brands-svg-icons';
import { faDatabase } from '@fortawesome/free-solid-svg-icons';
import React from 'react';
import InfoCard from './infoCard';
import {
  ProjectContainer,
  ProjectText,
  ProjectsIntro,
  ProjectTitle,
  ProjectSubtitle,
  ProjectDescription,
  ToolsContainer
} from './styles';


const Projects = () => {
  return (
    <div>
      <ProjectsIntro>On my free time... </ProjectsIntro>
      <ProjectContainer>
        <ProjectText>
          <ProjectTitle>google clone search engine</ProjectTitle>
          <ProjectSubtitle>PERSONAL SIDE PROJECT: WEB APP DESIGN</ProjectSubtitle>
          <ProjectDescription>Designed and built my own search engine service like Google</ProjectDescription>
          <ToolsContainer>
            <InfoCard color="#5A90E7" icon={faJsSquare} name="Javascript" />
            <InfoCard color="#5A90E7" icon={faDatabase} name="MySQL" />
          </ToolsContainer>

        </ProjectText>
      </ProjectContainer>
    </div>
  )
}
export default Projects
